import base64toblob from 'base64toblob';

import exifService from '../../src/services/exifService';

describe('exifService', () => {
    it('should return orientation of 1', async () => {
        const imageBase64 = '';
        const blob = base64toblob(imageBase64, 'image/jpeg');
        const file = new File([blob], 'tempName');

        const orientation = await exifService.determineOrientation(file);

        expect(orientation).toBe(1);
    });

    it('should return orientation of 4', async () => {
        const imageBase64 = '';
        const blob = base64toblob(imageBase64, 'image/jpeg');
        const file = new File([blob], 'tempName');

        const orientation = await exifService.determineOrientation(file);

        expect(orientation).toBe(4);
    });

    it('should return because not jpeg', async () => {
        const imageBase64 = 'iVBORw0KGgoAAAANSUhEUgAAAMYAAAD/CAMAAACdMFkKAAAAA1BMVEXuQh48RtCUAAAASElEQVR4nO3BAQ0AAADCoPdPbQ43oAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAADODMY5AAEanhaiAAAAAElFTkSuQmCC';
        const blob = base64toblob(imageBase64, 'image/jpeg');
        const file = new File([blob], 'tempName');

        const orientation = await exifService.determineOrientation(file);

        expect(orientation).toBe(undefined);
    });

    it('should break because has byte stuffing', async () => {
        const imageBase64 = '';
        const blob = base64toblob(imageBase64, 'image/jpeg');
        const file = new File([blob], 'tempName');

        const orientation = await exifService.determineOrientation(file);

        expect(orientation).toBe(undefined);
    });

    it('should return orientation of 1 and has exif gps data', async () => {
        const imageBase64 = '';
        const blob = base64toblob(imageBase64, 'image/jpeg');
        const file = new File([blob], 'tempName');

        const orientation = await exifService.determineOrientation(file);

        expect(orientation).toBe(1);
    });

    it('should return because has application segment 1, but no exif data', async () => {
        const imageBase64 = '';
        const blob = base64toblob(imageBase64, 'image/jpeg');
        const file = new File([blob], 'tempName');

        const orientation = await exifService.determineOrientation(file);

        expect(orientation).toBe(undefined);
    });
});
